00:00','MTB alebo valce 1h',NULL),(448,1,1,'2014-12-27','01:00:00','MTB alebo valce 1h',NULL),(449,1,6,'2014-12-28','04:00:00','',NULL),(451,1,NULL,'2015-01-01','00:00:00','',1),(452,1,8,'2015-01-12','00:00:00','REST DAY\r\nIf you decide you REALLY want to ride today, the goal is to take it easy and get your blood moving a little bit. Otherwise, take the day off from riding, you\'ve got some big rides the rest of the week and you need to be rested and ready to ride hard. ',NULL),(454,1,1,'2015-01-13','01:30:00','ENDURANCE MILES 1-2hours. The goal of today\'s Endurance Miles ride is two-fold. One is to work on the development of your aerobic system (so no need to ride hard!) and the other is to wake your legs up from an easier day or two and get prepared for the intervals you\'ll be doing tomorrow. ',NULL),(455,1,1,'2015-01-14','02:30:00','CLIMBING REPEAT INTERVALS 2h 15m - 2h 45m total. 5x6 minute Climbing Repeats (4 minutes rest between intervals) - Increased climbing power at lactate threshold. (85-90 RPM).\r\nThe CR\'s today will tax your climbing lactate threshold and ultimately improve your ability to sustain a higher power for medium/long efforts. In order to maximize the benefits today, you\'ll want to meter your effort so that the last few intervals are a real challenge to complete. If you fall apart on the last rep, then you probably did it correctly!  ',NULL),(457,1,1,'2015-01-15','02:30:00','STEADY STATE INTERVALS 2h 15m - 2h 45m total. 4x12 minute Steady State Intervals (5 minutes rest between intervals). Increased sustained power at lactate threshold on flat/rolling terrain. (85-95 RPM). Today\'s Steady State intervals have a similar goal to yesterday, except they\'re more likely to be done on flatter terrain. The intent is still to improve your lactate threshold, but the intensity is slightly lower since the intervals are longer and more total time at intensity. You still want to be completely exhausted by the end of the last interval though, nothing left in the tank! ',NULL),(458,1,8,'2015-01-16','00:00:00','REST DAY. Rest today and let your body heal for the weekend workouts!',NULL),(459,1,1,'2015-01-17','04:00:00','STEADY STATE INTERVALS 3h 30m - 4h 30m total. 3x15 minute Steady State Intervals (6 minutes rest between intervals). Increased sustained power at lactate threshold on flat/rolling terrain. (85-95 RPM). The Steady State intervals within today\'s Endurance Miles ride come with the same goals as Thursday\'s intervals. You want to exhaust your ability to perform work at threshold, but then continue on for a little more endurance riding (easier effort). ',NULL),(460,1,1,'2015-01-18','03:30:00','ENDURANCE MILES 3 - 4h. With two easier days following this ride, the goal is to really push the envelope of your aerobic engine. Your body is already a little pre-fatigued, which means it won\'t take as long to get to the limits of your aerobic capacity. Ride how you feel today.',NULL),(461,1,8,'2015-01-19','00:00:00','REST DAY\r\nIf you decide you REALLY want to ride today, the goal is to take it easy and get your blood moving a little bit. Otherwise, take the day off from riding, you\'ve got some big rides the rest of the week and you need to be rested and ready to ride hard. ',NULL),(462,1,1,'2015-01-20','01:30:00','ENDURANCE MILES 1-2hours. You\'ve had a few hard days of riding now, so take it easy on today\'s Endurance Miles ride. The goal of today\'s ride is two-fold. One is to work on the development of your aerobic system (so no need to ride hard!) and the other is to wake your legs up from an easier day or two and get prepared for the intervals you\'ll be doing tomorrow. Whatever you do, don\'t compromise your energy available for the rest of the week\'s hard riding.',NULL),(463,1,1,'2015-01-21','02:30:00','POWER INTERVALS 2h 15m - 2h 45m total. 3x3 minute and 4x2 minute Max Efforts (equal rest between intervals - 3 minute and 2 minute). Increased power at VO2 max. (95+ RPM). Today\'s goal is to ride as hard as you can during each interval, with the intention of achieving the highest heart rate and oxygen consumption you can. Your speed or power may be compromised at the end of each rep or at the end of the workout but as long as you\'re working maximally and still achieving high HR\'s and breathing heavily, the benefits of the workout remain intact. ',NULL),(464,1,2,'2015-03-04','00:45:00','',NULL),(465,1,1,'2015-03-04','02:00:00','',NULL),(466,1,1,'2015-03-05','04:00:00',' ',91),(467,1,7,'2015-03-06','01:00:00',' ',NULL),(468,1,1,'2015-03-06','01:30:00','',NULL),(469,1,1,'2015-03-08','03:00:00','',NULL),(470,1,NULL,'2015-03-08','00:45:00','',NULL),(471,1,1,'2015-03-02','04:00:00','',NULL),(474,1,1,'2015-04-12','04:30:00','Preteky Sucha nad parnou',2),(476,1,1,'2015-04-13','04:00:00','Vytrvalostný tréning',NULL),(477,1,1,'2015-04-14','01:00:00','Kompenzácia, ľahký deň',1),(480,1,7,'2015-04-23','01:00:00','Posilka, šetriť nohy',NULL),(481,1,1,'2015-04-19','04:00:00','ľahké prevody, cvičenia zo sedla',NULL),(482,1,1,'2015-04-17','01:45:00','Zapracovanie',NULL),(485,1,1,'2015-04-26','04:30:00','Preteky Krupina',NULL),(486,1,1,'2015-04-18','04:30:00','Preteky Kyjov',NULL),(487,1,1,'2015-04-25','01:45:00','Zapracovanie',NULL),(488,1,1,'2015-04-22','02:30:00','Some efforts',NULL),(489,1,1,'2015-04-23','04:30:00','Striedanie ľahkých aj ťažších prevodov, jazda zo sedla, krátke zrýchlenia z 80 na 105-110 ot',NULL),(490,1,2,'2015-04-21','00:45:00','',NULL),(491,1,1,'2015-04-21','03:00:00','',NULL),(492,1,7,'2015-04-15','01:00:00','',NULL),(493,1,2,'2015-04-13','00:50:00','',NULL),(494,1,1,'2015-04-15','02:00:00','Sprinty Edelsthal, 4x',NULL),(495,1,1,'2015-04-27','02:00:00','Beh + Bike',NULL),(496,1,1,'2015-04-29','01:20:00','',NULL),(497,1,2,'2015-04-29','00:40:00','',NULL),(498,1,1,'2015-04-30','04:00:00','Super ľahký pomalý tréning ',NULL),(499,1,7,'2015-05-01','01:00:00','Kvalitná fáza, plný kotol ale nižšie váhy a 12-15 opakovaní.',NULL),(500,1,1,'2015-05-01','02:00:00