--
-- Table structure for table `user`
--

DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_role` int(11) NOT NULL,
  `id_address` int(11) DEFAULT NULL,
  `id_primary_activity` int(11) DEFAULT NULL,
  `id_user_fitness` int(11) DEFAULT NULL,
  `id_privacy` int(11) DEFAULT NULL,
  `name` varchar(30) NOT NULL,
  `lastname` varchar(30) DEFAULT NULL,
  `fullname` varchar(60) NOT NULL,
  `username` varchar(20) NOT NULL,
  `password` varchar(40) NOT NULL,
  `email` varchar(40) NOT NULL,
  `gender` char(1) NOT NULL,
  `birthday` date DEFAULT NULL,
  `phone` varchar(15) DEFAULT NULL,
  `about` varchar(250) DEFAULT NULL,
  `profile_picture` varchar(100) DEFAULT NULL,
  `account_status` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `email` (`email`),
  KEY `id_role` (`id_role`),
  KEY `id_address` (`id_address`),
  KEY `id_primary_activity` (`id_primary_activity`),
  KEY `id_user_fitness` (`id_user_fitness`),
  KEY `id_privacy` (`id_privacy`),
  CONSTRAINT `user_ibfk_1` FOREIGN KEY (`id_role`) REFERENCES `role` (`id`),
  CONSTRAINT `user_ibfk_2` FOREIGN KEY (`id_address`) REFERENCES `address` (`id`),
  CONSTRAINT `user_ibfk_3` FOREIGN KEY (`id_primary_activity`) REFERENCES `activity` (`id`),
  CONSTRAINT `user_ibfk_4` FOREIGN KEY (`id_user_fitness`) REFERENCES `user_fitness` (`id`),
